    return (
        <>
        <div className='page-name'
        style = {{
            height: '120px',
        }}>

        <h1 style = {{
            fontSize: '60px',
            paddingTop: '20px',
            paddingBottom: '25px'
         }}>Business</h1>

        </div>
        <Template {...businessObjOne} />
